    return (<section className="homepage">
        <Title/>
        <PageBody />
    </section>)
}

function PageBody() {
    return (
        <div className="pagebody">
            <ClasifyForm />
        </div>
    )
}

function ClasifyForm(){
    return (
        <div className="clasify">

        </div>
    )
}

